import os, struct, zlib, time

def utf8(value) -> bytes:
    return struct.pack(">I", len(value)) + value.encode("utf-8")

def crc(value) -> bytes:
    # This implemenatation is wrong, but still the game dosent need right ones.
    value = value.encode("utf-8")
    value = zlib.crc32(value)
    return struct.pack("<I", value)

def path_utf8(path, file) -> bytes:
    path = path.encode("utf-8")
    file = file.encode("utf-8")
    crc = zlib.crc32(file)
    return struct.pack(">I", len(file)) + file + struct.pack(">I", len(path)) + path + struct.pack(">I", crc)

